import React, { Component } from 'react';

import statBackground from '../assets/estadisticas-background.jpg';
import Statistic from './Statistic';

import { faChartArea, faChartLine, faChartBar } from '@fortawesome/free-solid-svg-icons';

class Estadisticas extends Component {
    render() {
        const arrayOfStadistics = [
            { id: "1", title: "Años de experiencia", value: "15", img: faChartArea },
            { id: "2", title: "Media anual de clientes", value: "600", img: faChartLine },
            { id: "3", title: "Rating", value: "4.3", img: faChartBar },
        ];

        // const why_us = [
        //     { id: 1, reason: "Garantía en nuestros servicios" },
        //     { id: 2, reason: "Velocidad de entrega" },
        //     { id: 3, reason: "Personal capacitado" }
        // ]

        const Statistics = arrayOfStadistics.map(statistic => {
            return (
                <Statistic
                    key={statistic.id}
                    title={statistic.title}
                    value={statistic.value}
                    img={statistic.img}
                    alt={statistic.alt}
                />
            )
        })
        return (
            <section data-aos="fade-up" id="statistic" className="statistic-component">
                <svg
                    className="fondo-landing"
                    xmlns="http://www.w3.org/2000/svg"
                    width="100%" height="450px">
                    <image opacity="0.451" x="0px" y="0px" width="100%" height="622px" href="data:img/png;base64," />
                </svg>
                <svg
                    className="fondo-landing"
                    xmlns="http://www.w3.org/2000/svg"
                    xmlns="http://www.w3.org/1999/xlink"
                    width="100%" height="450px">
                    <image x="0px" y="0px" width="100%" height="450px" href="data:img/png;base64," />
                </svg>
                <div className="statistic-container container">
                    {Statistics}
                </div>
                {/* <div>
                    <h2>¿Por qué nosotros?</h2>
                </div> */}
            </section>
        )
    }
}

export default Estadisticas;